description:
Spectrum TPH 3 (Спектрум) - рентгеноконтрастный фотополимеризуемый гибридный композит со сверхмелким размером частиц для изготовления реставраций во фронтальной и жевательной группах зубов. Композит выпускается в дозированных компьюлах и традиционных шприцах, и позволяет точно подбирать оттенки по шкале Vita. "Спектрум ТРН” - универсальная композитная система с простым практическим применением. Нововведенные ключевые компоненты даже отдельно взятые, хороши как для стоматолога, так и пациента.
Практический опыт и клиническое тестирование показали, что "Спектрум ТРН", микрогибридный композит фирмы Дентсплай, является «идеальным» материалом для реставрации передних и боковых зубов, полностью отвечающий основным требованиям предъявляемых к данной работе:
безупречное краевое прилегание;
надежное, простое применение;
оптимальные эстетические требования.

