Показания:
– Прямые светоотверждаемые композитные и компомерные реставрации;
– Прямое восстановление культи свето- и самотвердеющими композитами и композитами двойного отверждения;
– Применение при починке сколовшихся композитных и компомерных пломб;
– Клеевая фиксация непрямых реставраций со светоотверждаемыми композитами и композитами двойного отверждения;
– Герметизация подготовленных поверхностей зуба до временного или постоянного цементирования непрямой пломбы;
