characteristics:
Показания к применению:

ретроградное пломбирование верхушки зуба;
устранение перфораций корня;
устранение перфораций дна полости зуба;
апексификация;
устранение внутренней и внешней резорбций корня;
пломбирование верхушечной части канала;
лечебно-изолирующее покрытие пульпы.
Особенности и преимущества:

Материалу присуща высокая герметизирующая способность, которая практически не изменяется при попадании крови. 
Материал обладает высоким значением pH≈12, вследствие чего имеет ярко выраженный бактерицидный эффект. 
Канал МТА по своим механическим свойствам близок к природному дентину и цементу корня. 
Не содержит мономеров. 
Материал стимулирует остеогенез и цементогенез, обладает высокой прочностью и долговечностью.
Канал МТА состоит из смеси гидрофильных частиц: в основном – трикальций силиката, а также кальцийсодержащих соединений железа и алюминия. 
Материал отверждается при взаимодействии с водой, увеличивая прочность на сжатие с течением времени.
Время между началом замешивания и началом твердения стоматологического материала составляет примерно 12 мин.

